import React from 'react';
import { useNavigate } from 'react-router-dom';
import './AdaptationPage.css';

const AdaptationPage = () => {
  const navigate = useNavigate();

  const handleFirstDay = () => {
    navigate('/FirstDayAdaptation');
  };

  return (
    <div className="adaptation-container">
      <h1 className="adaptation-title">План адаптации</h1>
      <div className="adaptation-buttons">
        <button className="adaptation-btn" onClick={handleFirstDay}>1 день</button>
        <button className="adaptation-btn">2 день</button>
        <button className="adaptation-btn">3 день</button>
        <button className="adaptation-btn">4 день</button>
      </div>
    </div>
  );
};

export default AdaptationPage;
